import React from 'react';
import {Form,Button, Container,Row,Col} from 'react-bootstrap';
import {Link} from 'react-router-dom';

function AutoScreen() {
  return (
    <Container>
      <Row md={6} className="justify-content-center">
        <Col>
           <Form className="container my-2" expand="lg">
             <Form.Group>
               <Form.Label htmlFor="Email">Email:</Form.Label>
               <Form.Control type="email" name="Email" placeholder='Email'/>

               <Form.Label htmlFor="password">Password:</Form.Label>
               <Form.Control type="password" name='password' placeholder='Password'/>
        
               <Form.Group className='d-grid'>
                  <Button type='submit' className='my-2 btn btn-success d-flex btn btn-block' variant="success" expand="lg">Send</Button>
               </Form.Group>
               <p className='container'>Hesab ın yok mu?</p><Link to="/signup">Sign up</Link>
             </Form.Group>
           </Form>
        </Col>
      </Row>
    </Container>
  )
}

export default AutoScreen;
